import React from "react";
import { Link, Routes, Route } from "react-router-dom";
import "./NavBar.css";

const NavBar = () => {
  let isLogin = true;

  return (
    <div class="navbar">
      <Link to="#landingPage">SantaIsSanta</Link>
      <div class="dropdown">
        <button class="dropbtn">
          지역별
          <i class="fa fa-caret-down"></i>
        </button>
        <div class="dropdown-content">
          <Link to="#">수도권</Link>
          <Link to="#">강원도</Link>
          <Link to="#">경상도</Link>
          <Link to="#">전라도</Link>
          <Link to="#">충청도</Link>
          <Link to="#">제주도</Link>
        </div>
        <Link to="">커뮤니티</Link>
        {isLogin ? <Link to="/">로그인</Link> : <Link to="/">로그아웃</Link>}
        <Link to="/">마이페이지</Link>
      </div>
    </div>
  );
};

export default NavBar;
